import React, { useState } from 'react';

const RequisitionForm = () => {
  // State for form fields
  const [financialYear, setFinancialYear] = useState('');
  const [selectedDivision, setSelectedDivision] = useState('');
  const [selectedPeriod, setSelectedPeriod] = useState('');
  const [commencementDate, setCommencementDate] = useState('');
  const [completionDate, setCompletionDate] = useState('');
  const [natureOfWork, setNatureOfWork] = useState('');
  const [projectName, setProjectName] = useState('');
  const [workOrderNo, setWorkOrderNo] = useState('');
  const [workOrderValue, setWorkOrderValue] = useState('');
  const [skilledApprovedNumber, setSkilledApprovedNumber] = useState('');

  // Dummy data
  const divisionLists = [
    { divisionShortName: 'DIV1', divisionName: 'Division 1' },
    { divisionShortName: 'DIV2', divisionName: 'Division 2' },
    { divisionShortName: 'DIV3', divisionName: 'Division 3' },
  ];

  const timePeriods = ['1 Month', '3 Months', '6 Months', '1 Year'];
  const financialYears = ['2023-2024', '2024-2025', '2025-2026', '2026-2027'];

  const handleSubmit = (e) => {
    e.preventDefault();

    const formData = {
      financialYear,
      selectedDivision,
      selectedPeriod,
      commencementDate,
      completionDate,
      natureOfWork,
      projectName,
      workOrderNo,
      workOrderValue,
      skilledApprovedNumber,
    };

    console.log('Form Submitted:', formData);
    // TODO: API call or data processing
  };

  return (
    <div className="container mt-4">
      <h3>Requisition for Extraneous Manpower</h3>
      <form onSubmit={handleSubmit}>
        {/* Financial Year Dropdown */}
        <div className="form-group">
          <label htmlFor="financialYear">Financial Year</label>
          <select
            className="form-control"
            id="financialYear"
            value={financialYear}
            onChange={(e) => setFinancialYear(e.target.value)}
            required
          >
            <option value="">Select Financial Year</option>
            {financialYears.map((year) => (
              <option key={year} value={year}>{year}</option>
            ))}
          </select>
        </div>

        {/* Division Dropdown */}
        <div className="form-group">
          <label htmlFor="division">Select Division</label>
          <select
            className="form-control"
            id="division"
            value={selectedDivision}
            onChange={(e) => setSelectedDivision(e.target.value)}
            required
          >
            <option value="">Select Division</option>
            {divisionLists.map((div) => (
              <option key={div.divisionShortName} value={div.divisionShortName}>
                {div.divisionName}
              </option>
            ))}
          </select>
        </div>

        {/* Time Period */}
        <div className="form-group">
          <label htmlFor="period">Select Type</label>
          <select
            className="form-control"
            id="period"
            value={selectedPeriod}
            onChange={(e) => setSelectedPeriod(e.target.value)}
            required
          >
            <option value="">Select Period</option>
            {timePeriods.map((period) => (
              <option key={period} value={period}>{period}</option>
            ))}
          </select>
        </div>

        {/* Dates */}
        <div className="form-group">
          <label htmlFor="commencementDate">Date of Commencement</label>
          <input
            type="date"
            className="form-control"
            id="commencementDate"
            value={commencementDate}
            onChange={(e) => setCommencementDate(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="completionDate">Expected Date of Completion</label>
          <input
            type="date"
            className="form-control"
            id="completionDate"
            value={completionDate}
            onChange={(e) => setCompletionDate(e.target.value)}
            required
          />
        </div>

        {/* Text Fields */}
        <div className="form-group">
          <label htmlFor="natureOfWork">Nature of Work/Job</label>
          <input
            type="text"
            className="form-control"
            id="natureOfWork"
            value={natureOfWork}
            onChange={(e) => setNatureOfWork(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="projectName">Name of the Project</label>
          <input
            type="text"
            className="form-control"
            id="projectName"
            value={projectName}
            onChange={(e) => setProjectName(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="workOrderNo">Work Order No.</label>
          <input
            type="text"
            className="form-control"
            id="workOrderNo"
            value={workOrderNo}
            onChange={(e) => setWorkOrderNo(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="workOrderValue">Value of the Work Order</label>
          <input
            type="number"
            className="form-control"
            id="workOrderValue"
            value={workOrderValue}
            onChange={(e) => setWorkOrderValue(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="skilledApprovedNumber">Skilled Manpower (Approved Number)</label>
          <input
            type="number"
            className="form-control"
            id="skilledApprovedNumber"
            value={skilledApprovedNumber}
            onChange={(e) => setSkilledApprovedNumber(e.target.value)}
            required
          />
        </div>

        <button type="submit" className="btn btn-primary">Submit</button>
      </form>
    </div>
  );
};

export default RequisitionForm;
